  true,\n\t\"url\": null,\n\t\"notes\": \"The 2004 Environmental Vulnerability Index
  (EVI) portion of the Compendium of Environmental Sustainability Indicator Collections
  contains 111 variables for 235 countries and territories. This index is designed
  to be used with economic and social vulnerability indices to provide insights into
  the processes that can negatively influence the sustainable development of countries.
  It was developed through consultation and collaborations with countries, institutions
  and experts across the globe by the South Pacific Applied Geoscience Commission
  (SOPAC), the United Nations Environment Programme (UNEP) and their partners. The
  data are distributed by the Columbia University Center for International Earth Science
  Information Network (CIESIN).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
